// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ContractPatient.sol";
import "./ContractDoctor.sol";

contract Manager {
    address public admin;

    // Références vers les contrats des Patients et Docteurs
    Patient public patientContract;
    Doctor public doctorContract;

    // Structure pour enregistrer les actions effectuées
    struct AuditLog {
        address actor;
        string action;
        uint timestamp;
    }

    // Mappage pour garder une trace des actions effectuées sur chaque dossier médical
    mapping(address => AuditLog[]) public patientAuditLogs;
    mapping(address => AuditLog[]) public doctorAuditLogs;

    modifier onlyAdmin() {
        require(msg.sender == admin, "Seul l'admin peut effectuer cette action.");
        _;
    }

    constructor(address _patientContract, address _doctorContract) {
        admin = msg.sender;
        patientContract = Patient(_patientContract);
        doctorContract = Doctor(_doctorContract);
    }

    function registerPatient(address _patientAddress, string memory _name) public onlyAdmin {
        patientContract.registerPatient(_patientAddress, _name);
        
        // Enregistrement de l'action dans l'audit
        patientAuditLogs[_patientAddress].push(AuditLog({
            actor: msg.sender,
            action: "Enregistrement du patient",
            timestamp: block.timestamp
        }));
    }

    function registerDoctor(address _doctorAddress, string memory _name) public onlyAdmin {
        doctorContract.registerDoctor(_doctorAddress, _name);

        // Enregistrement de l'action dans l'audit
        doctorAuditLogs[_doctorAddress].push(AuditLog({
            actor: msg.sender,
            action: "Enregistrement du docteur",
            timestamp: block.timestamp
        }));
    }

    // Fonction pour obtenir l'historique des actions d'un patient
    function getPatientAuditLogs(address _patientAddress) public view returns (AuditLog[] memory) {
        return patientAuditLogs[_patientAddress];
    }

    // Fonction pour obtenir l'historique des actions d'un docteur
    function getDoctorAuditLogs(address _doctorAddress) public view returns (AuditLog[] memory) {
        return doctorAuditLogs[_doctorAddress];
    }
}

Contracts/ContractDoctor.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./ContractPatient.sol";

contract Doctor {
    struct DoctorData {
        address doctorAddress;
        string name;
        bool isRegistered;
    }

    mapping(address => DoctorData) public doctors; // Liste des docteurs enregistrés
    Patient public patientContract; // Référence au contrat Patient

    // Événements
    event DoctorRegistered(address indexed doctorAddress, string name);
    event RecordUpdated(
        address indexed patientAddress,
        string recordHash,
        address updatedBy,
        uint256 timestamp
    );

    // Modificateur : vérifie si l'appelant est un docteur enregistré
    modifier onlyRegisteredDoctor() {
        require(doctors[msg.sender].isRegistered, "Vous devez etre un docteur enregistre.");
        _;
    }

    // Constructeur : initialisation du contrat Patient
    constructor(address _patientContract) {
        require(_patientContract != address(0), "Adresse du contrat Patient invalide.");
        patientContract = Patient(_patientContract);
    }

    // Fonction pour enregistrer un docteur
    function registerDoctor(address _doctorAddress, string memory _name) public {
        require(_doctorAddress != address(0), "Adresse du docteur invalide.");
        require(!doctors[_doctorAddress].isRegistered, "Docteur deja enregistre.");

        doctors[_doctorAddress] = DoctorData({
            doctorAddress: _doctorAddress,
            name: _name,
            isRegistered: true
        });

        emit DoctorRegistered(_doctorAddress, _name);
    }

    // Fonction pour ajouter un dossier médical à un patient
    function addRecordForPatient(address _patientAddress, string memory _recordHash)
    public
    onlyRegisteredDoctor
{
    require(_patientAddress != address(0), "Adresse du patient invalide.");
    require(bytes(_recordHash).length > 0, "Hash du dossier medical invalide.");

    // Vérifie si le docteur est autorisé pour ce patient
    require(
        patientContract.isDoctorAuthorized(_patientAddress, msg.sender),
        "Acces non autorise pour ce patient."
    );

    // Appelle la fonction addMedicalRecord avec un seul argument (le hash du dossier)
    patientContract.addMedicalRecord(_recordHash);

    // Émet un événement pour signaler l'ajout du dossier médical
    emit RecordUpdated(_patientAddress, _recordHash, msg.sender, block.timestamp);
}

}

Contracts/ContractPatient.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract Patient {
    struct PatientData {
        address patientAddress;
        string name;
        bool isRegistered;
        mapping(address => bool) authorizedDoctors; // Map of authorized doctors
        string[] recordsHashes;
    }

    mapping(address => PatientData) public patients;

    event PatientRegistered(address patientAddress, string name);
    event AccessGranted(address indexed patientAddress, address indexed doctorAddress);
    event AccessRevoked(address indexed patientAddress, address indexed doctorAddress);
    event RecordAdded(address indexed patientAddress, string recordHash);

    modifier onlyRegisteredPatient() {
        require(patients[msg.sender].isRegistered, "Vous devez etre un patient enregistre.");
        _;
    }

    function registerPatient(address _patientAddress, string memory _name) public {
        require(!patients[_patientAddress].isRegistered, "Patient deja enregistre.");
        patients[_patientAddress].isRegistered = true;
        patients[_patientAddress].name = _name;
        emit PatientRegistered(_patientAddress, _name);
    }

    function grantAccess(address _doctorAddress) public onlyRegisteredPatient {
        patients[msg.sender].authorizedDoctors[_doctorAddress] = true;
        emit AccessGranted(msg.sender, _doctorAddress);
    }

    function revokeAccess(address _doctorAddress) public onlyRegisteredPatient {
        require(
            patients[msg.sender].authorizedDoctors[_doctorAddress],
            "Acces deja revoque ou non autorise."
        );
        patients[msg.sender].authorizedDoctors[_doctorAddress] = false;
        emit AccessRevoked(msg.sender, _doctorAddress);
    }

    function isDoctorAuthorized(address _patientAddress, address _doctorAddress)
        public
        view
        returns (bool)
    {
        return patients[_patientAddress].authorizedDoctors[_doctorAddress];
    }

    function addMedicalRecord(string memory _recordHash) public onlyRegisteredPatient {
        patients[msg.sender].recordsHashes.push(_recordHash);
        emit RecordAdded(msg.sender, _recordHash);
    }

    function getRecords(address _patientAddress) public view returns (string[] memory) {
        return patients[_patientAddress].recordsHashes;
    }
}

